INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (1, 0.0, 10040, 24001, "あたしだって\nやるときはやるよ！", "2030/12/17 14:59:59", 0.0, 1, "2020/04/30 12:00:00", 102601, "リン", 0.0, 0, 24);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (1, 0.0, 10040, 24002, "ふぅ…\nこれであたしの仕事は\n終わりだね", "2030/12/17 14:59:59", 0.0, 1, "2020/04/30 12:00:00", 102601, "リン", 0.0, 1, 24);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (1, 0.0, 10040, 24003, "終わった終わった\n一人でもなんとか\nなるもんだね", "2030/12/17 14:59:59", 0.0, 1, "2020/04/30 12:00:00", 102601, "リン", 0.0, 2, 24);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (2, 0.0, 10040, 24004, "やったね！\nこれでようやく\nサボれるよ…", "2030/12/17 14:59:59", 0.0, 2, "2020/04/30 12:00:00", 102601, "リン", 0.0, 3, 24);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (1, 0.0, 10040, 24005, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", "2030/12/17 14:59:59", 0.0, 1, "2020/04/30 12:00:00", 102601, "リン", 0.0, 4, 24);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (2, 0.0, 10040, 24006, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", "2030/12/17 14:59:59", 0.0, 2, "2020/04/30 12:00:00", 102601, "リン", 0.0, 5, 24);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (2, 0.0, 10040, 24007, "あたしも意外と\nやるもんでしょ？", "2030/12/17 14:59:59", 0.0, 2, "2020/04/30 12:00:00", 102601, "リン", 0.0, 6, 24);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (4, 0.0, 10040, 24008, "疲れた…\nねずみの逃げ足\n速すぎるよ…", "2030/12/17 14:59:59", 0.0, 4, "2020/04/30 12:00:00", 102601, "リン", 0.0, 7, 24);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (4, 0.0, 10040, 24009, "このままじゃ\nまっひ～に\n叱られちゃうよ", "2030/12/17 14:59:59", 0.0, 4, "2020/04/30 12:00:00", 102601, "リン", 0.0, 8, 24);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (4, 0.0, 10040, 24010, "まじめに\nやったんだけどな…\n悔しいな～", "2030/12/17 14:59:59", 0.0, 4, "2020/04/30 12:00:00", 102601, "リン", 0.0, 9, 24);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (4, 0.0, 10040, 24011, "やられた…\nねずみって意外と\nてごわいね", "2030/12/17 14:59:59", 0.0, 4, "2020/04/30 12:00:00", 102601, "リン", 0.0, 10, 24);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (4, 0.0, 10040, 24012, "おのれ～\nあたしのチーズを\n盗みやがって～！", "2030/12/17 14:59:59", 0.0, 4, "2020/04/30 12:00:00", 102601, "リン", 0.0, 11, 24);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (4, 0.0, 10040, 24013, "疲れた…\nけど、次こそは\n守り抜くよ…", "2030/12/17 14:59:59", 0.0, 1, "2020/04/30 12:00:00", 102601, "リン", 1.81, 12, 24);
